syntax = "proto3";
package reports;
import "google/protobuf/struct.proto";

option go_package = "github.com/untangle/golang-shared/structs/protocolbuffers/PacketdReply";

message PacketdReply {
    string ServerError = 1;
    repeated google.protobuf.Struct Conntracks = 2;
    repeated google.protobuf.Struct TestInfo = 3;

    
}